import React from 'react';
import carData from '../assets/data/carData';
import { Container, Row, Col, Card, Button } from 'react-bootstrap';

const CarSell = () => {
  return (
    <Container className="my-5">
      <h1 className="text-center mb-4">Car Selling Posts</h1>
      <Row>
        {carData.map((car) => (
          <Col md={4} key={car.id} className="mb-4">
            <Card>
              <Card.Img variant="top" src={car.imgUrl} alt={car.carName} />
              <Card.Body>
                <Card.Title>{car.carName}</Card.Title>
                <Card.Text>
                  <p>Brand: {car.brand}</p>
                  <p>Model: {car.model}</p>
                  <p>Price: ${car.price}</p>
                  <p>Rating: {car.rating}</p>
                  <p>Speed: {car.speed}</p>
                  <p>GPS: {car.gps}</p>
                  <p>Seat Type: {car.seatType}</p>
                  <p>Transmission: {car.automatic}</p>
                  <p>Description: {car.description}</p>
                  {car.carRentalService && (
                    <p>Rental Service: {car.carRentalService}</p>
                  )}
                  {car.features && (
                    <div>
                      <h5>Features:</h5>
                      <ul>
                        {car.features.map((feature, index) => (
                          <li key={index}>{feature}</li>
                        ))}
                      </ul>
                    </div>
                  )}
                </Card.Text>
                <Button variant="primary">Buy Now</Button>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default CarSell;
